import React from "react";
import AppLayout from "../components/AppLayout";
import LangdingLayout from "../components/LangdingLayout";

const Home = () => {
  return (
    <LangdingLayout>
      <div>Hello intro!</div>
      <div className = "Box-1_intro-text">
        <p>
          새로운 분야에 도전하거나 직업에 대한 전문성을 키우고 싶은 분들을 위한
        </p>
        <br />
        <p>
          학습 종합 플랫폼 -
        </p>
        <p>
          NextPus에 오신 걸 환영합니다.
        </p>
      </div>
    </LangdingLayout>
  );
};

export default Home;
